plt.plot(frequencies,lw=2) # make nice color, labels
plt.xlabel('Templates sorted by frequency')
plt.ylabel('Number of lemmas described by template')
plt.title('Template frequency')
plt.grid()
plt.savefig('Freq.pdf')
plt.show()
plt.close()

cumfreq = np.cumsum(frequencies)
fsum = sum(frequencies)
cumfreqpercent = [x*100/fsum for x in cumfreq]
plt.plot(cumfreqpercent,lw=2)
plt.ylabel('Cumulative percentage of lemmas described by templates')
plt.xlabel('Templates sorted by frequency')
plt.title('Cumulative frequency of templates')
x=np.arange(len(frequencies))
plt.fill_between(x,0,cumfreqpercent,alpha=0.5)
plt.grid()
plt.savefig('CumFreq.pdf')
plt.show()
plt.close()
